import '../Cadastro.css';
import { useNavigate } from 'react-router-dom';

function Cadastro() {
  const navigate = useNavigate();

  return (
    <div className="container">
      <div className="image-section">
        <div className="overlay"></div>
      </div>
      <div className="form-section">
        <div className="form-container">
          <h1>{isLogin ? 'Hello, Welcome Back!' : 'Hello, Welcome!'}</h1>
          <input type="text" placeholder="Username" />
          {!isLogin && <input type="email" placeholder="Email" />}
          <input type="password" placeholder="Password" />
          <button>{isLogin ? 'Sign In' : 'Sign Up'}</button>
          <div className="toggle">
            {isLogin ? (
              <span>Don't have an account? <a href="#" onClick={toggleMode}>Sign Up</a></span>
            ) : (
              <span>Already have an account? <a href="#" onClick={toggleMode}>Sign In</a></span>
            )}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Cadastro;
